    for (var i = 0; i < markers.length; i++) {

        c += 'medium';

        c += 'large';
    }

    return new L.DivIcon({ html: '<div><span style="font-size: 7pt">' + sum_total + '</span></div>', className: 'marker-cluster' + c, iconSize: new L.Point(40, 40) });

    };
